import * as React from 'react';
import {
  DataGrid,
  GridToolbarContainer,
  GridToolbarColumnsButton,
  GridToolbarFilterButton,
  GridToolbarExport,
  GridToolbarDensitySelector,
} from '@mui/x-data-grid';
import { useDemoData } from '@mui/x-data-grid-generator';

function CustomToolbar() {
  return (
    <GridToolbarContainer>
      <GridToolbarColumnsButton />
      <GridToolbarFilterButton />
      <GridToolbarDensitySelector />
      <GridToolbarExport />
    </GridToolbarContainer>
  );
}
const columns = [
    {
      field: 'ticker',
      headerName: 'TICKER',
      width: 150,
      editable: true,
    },
    {
        field: 'ceiling',
        headerName: 'CEILING',
        type: 'number',
        width: 110,
        editable: true,
      },
    {
      field: 'floor',
      headerName: 'FLOOR',
      type: 'number',
      width: 110,
      editable: true,
    },
    {
      field: 'highest',
      headerName: 'HIGHEST',
      type: 'number',
      width: 110,
      editable: true,
    },
    {
      field: 'lowest',
      headerName: 'LOWEST',
      type: 'number',
      width: 110,
      editable: true,
    },
    {
      field: 'match',
      headerName: 'MATCH',
      type: 'number',
      width: 110,
      editable: true,
    },
    {
      field: 'volume',
      headerName: 'VOLUME',
      type: 'number',
      width: 110,
      editable: true,
    },
  ];
  const rows = [
    ('ACB', 305, 3.7, 67, 4.3,0.4,1000),
    createData('APH', 452, 25.0, 51, 4.9,42.2,1000),
    createData('ASM', 262, 16.0, 24, 6.0,4.8,1000),
    createData('BCM', 159, 6.0, 24, 4.0,9.3,1000),
    createData('BHN', 356, 16.0, 49, 3.9,1.4,1000),
    createData('BID', 408, 3.2, 87, 6.5,1.4,1000),
    createData('BMP', 237, 9.0, 37,1.4, 4.3,1000),
    createData('BVH', 375, 0.0, 94, 0.0,1.4,1000),
    createData('CII', 518, 26.0, 65, 7.0,4.8,1000),
    createData('DCM', 392, 0.2, 98, 0.0,4.8,1000),
    createData('DGC', 318, 0, 81, 2.0,4.8,1000),
    createData('DGW', 360, 19.0, 9,4.8, 37.0,1000),
    createData('DHC', 437, 18.0, 63, 4.0,4.8,1000),
    createData('FLC', 437, 18.0, 63, 4.0,4.8,1000),
    createData('FPT', 437, 18.0, 63, 4.0,4.8,1000),
    createData('X20', 437, 18.0, 63, 4.0,4.8,1000),
  ]; 
    
export default function CustomToolbarGrid() {
  const { data } = useDemoData({
    dataSet: 'Commodity',
    rowLength: 10,
    maxColumns: 6,
  });

  return (
    <div style={{ height: 400, width: '100%', backgroundColor:'white' }}>
      <DataGrid
        {...data}
        components={{
          Toolbar: CustomToolbar,
        }}
      />
    </div>
  );
}
